import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Close mobile menu if present
    const mobileMenu = await page.$('.mobile-menu-overlay.show');
    if (mobileMenu) {
      await page.click('.close-mobile-menu');
    }

    // Click on "Your Profile" link
    await page.click('a:has-text("Your Profile"):visible');
    await page.waitForSelector('.profile-page', { timeout: 5000 });

    // Wait for profile content to load
    await page.waitForSelector('.profile-info h2', { timeout: 5000 });

    // Take screenshot of profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract profile information
    const fullName = await page.$eval('.profile-info h2', el => el.textContent.trim());
    const username = await page.$eval('.username', el => el.textContent.trim());

    return {
      success: true,
      action: "Navigated to Jun's Profile",
      extractedData: {
        fullName,
        username
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Jun's Profile",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
